              "label": "Cetuximab Plus Radiotherapy",
              "type": "EXPERIMENTAL",
              "description": "Concurrent Cetuximab plus Conformal Thoracic Radiotherapy (CTRT). Patients were treated with definitive radiotherapy (70 Gy in 35 fractions, per our currently-existing institutional standard) with concurrent cetuximab followed by 3 cycles of consolidation docetaxel plus cetuximab.",
              "interventionNames": [
