              "measure": "Overall Response Rate (ORR)",
              "description": "ORR = Complete Response (CR) + Partial Response (CR) according to Response Evaluation Criteria in Solid Tumors (RECIST) v1.0. Complete Response: Disappearance of all target lesions; Partial Response: At least a 30% decrease in the sum of the longest diameter (LD) of target lesions, taking as reference the baseline sum LD.",
