        "descriptionModule": {
          "briefSummary": "Randomized Clinical Trial Investigating Multidimensional Prehabilitation in Pancreatic Surgery for participants with Pancreatic and Periampullary Neoplasms",
          "detailedDescription": "Frailty is independently associated with an increased risk of adverse outcomes after major surgery, including pancreatic resection. Prehabilitation aims to optimize modifiable risk factors to improve participants' baseline health prior to surgery. Multiple studies with participants undergoing pancreatic surgery have investigated the impact of prehabilitation on preoperative health metrics as well as postoperative outcomes. The majority of these studies focused only on exercise; if nutritional and/or psychological status were assessed, these dimensions were not intervened upon in prehabilitation regimens or reassessed postoperatively. This randomized controlled trial (RCT) is designed to assess the impact of physical and nutritional prehabilitation on participants' perioperative condition for those undergoing pancreatic resection for diagnosed or suspected pancreatic and periampullary neoplasms."
        },
