        "armsInterventionsModule": {
          "armGroups": [
            {
              "label": "Control Arm (Standard of Care)",
              "type": "ACTIVE_COMPARATOR",
              "description": "Participants will receive the current standard preoperative education and counseling. Participants will receive information regarding exercise and nutrition from a member of the surgical team. Participants will meet with a behavioral medicine specialist for additional education regarding factors affecting postoperative stress and relaxation techniques. Participants who are actively smoking will be counseled regarding smoking cessation and offered a referral to smoking cessation resources.",
              "interventionNames": [
                "Behavioral: Behavioral Medicine",
                "Behavioral: Smoking Cessation"
              ]
            },
            {
              "label": "Intervention Arm (Prehabilitation)",
              "type": "EXPERIMENTAL",
              "description": "Participants in the intervention arm will receive all of the standard of care, as listed above, as well as individualized exercise and nutritional prehabilitation regimens.\n\nDuring the data analysis, participants will be subdivided into treatment groups, upfront surgical resection versus neoadjuvant chemotherapy, in order to determine whether length of prehabilitation affected outcomes and distinguish any possible effect of chemotherapy toxicity.",
              "interventionNames": [
                "Other: Exercise",
                "Dietary Supplement: Nutritional",
                "Behavioral: Behavioral Medicine",
                "Behavioral: Smoking Cessation"
