        "outcomesModule": {
          "primaryOutcomes": [
            {
              "measure": "Change in participants physical capacity, as represented by hand grip strength",
              "description": "Previous studies have demonstrated that grip strength is a predictor of surgical outcomes and mortality in cancer participants. Grip strength will be measured utilizing the Jamar Dynamometer.",
              "timeFrame": "3 weeks after the surgery"
            }
          ],
          "secondaryOutcomes": [
