              "measure": "Mortality Rate",
              "description": "Death due to any cause postoperatively.",
              "timeFrame": "Up to 90 days after the surgery"
            },
            {
              "measure": "Morbidity rate",
              "description": "Classified according to the Clavien-Dindo Classification of postoperative complications.",
              "timeFrame": "Up to 90 days after the surgery"
            },
            {
              "measure": "Physical capacity as represented by 30s CST (Chair Stand Test )",
              "description": "Participants rise to full standing position from sitting in a chair as many times as possible within 30 seconds. The 30s CST has been utilized as a reliable test of lower extremity strength.",
              "timeFrame": "3 weeks after the surgery"
            },
            {
              "measure": "Physical capacity as represented by 6-Minute Walk Test",
              "description": "Participants will walk as far as possible in 6 min at a comfortable pace but do not run or jog. If participants cannot complete the full 6 min walk, then record the time and distance walked and the reason for stopping early.",
              "timeFrame": "3 weeks after the surgery"
            }
          ]
