          "briefTitle": "Gliadel Wafer, Temozolomide and Radiation Therapy for Newly Diagnosed GBM",
          "officialTitle": "A Phase II Study of Gliadel, Concomitant Temozolomide and Radiation, Followed by Metronomic Therapy With Temozolomide for Newly Diagnosed Malignant High Grade Glioma"
        },
        "statusModule": {
          "statusVerifiedDate": "2009-09",
