        "descriptionModule": {
          "briefSummary": "This study is a single center, phase II study, to evaluate the effectiveness and safety of PD-1 Antibody(Tislelizumab) Plus Irinotecan Combined With POF(paclitaxel plus oxaliplatin plus 5-fluorouracil plus leucovorin) , in the first-line treatment for patients with advanced/metastatic gastric cancer.",
          "detailedDescription": "This is a exploratory, single-arm, open-label trial. The investigator's primary purpose is to compare that ORR of patients with Tislelizumab plus Irinotecan and POF for advanced/metastatic gastric cancer.\n\nIn treatment period, patients will be administrated Tislelizumab plus Irinotecan and POF, every 21 days for 1 cycle, until disease progression, toxicity intolerance, withdrawal of informed consent, patients judged must be terminated study termination.\n\nThe imaging evaluation was performed according to the RECIST 1.1 criteria every 6 weeks."
