        "outcomesModule": {
          "primaryOutcomes": [
            {
              "measure": "Objective response rate(ORR)",
              "description": "ORR was defined as percentage of participants with best (confirmed) overall response (BOR) of either CR or PR. ORR was assessed by the investigator according to RECIST version 1.1 and is based on BOR, which is defined as best response recorded from start of study treatment until disease progression/recurrence or death. Participants needed to have two consecutive assessments of PR or CR to be a responder. Only participants with measurable disease at baseline were included in the analysis of BOR and who did not have any evaluable post-baseline assessments were classified as not evaluable.The ORR will be reported by percentage with each arms and appropriate confidence intervals.",
              "timeFrame": "From enrollment to 12 month"
            }
          ],
          "secondaryOutcomes": [
            {
              "measure": "1.Progression-Free Survival(PFS)",
              "description": "PFS was defined as the time from randomization to first documented disease progression (PD) using Response Evaluation Criteria in Solid Tumors 1.1 (RECIST 1.1) or death from any cause, whichever occurred first. For target lesions, PD was defined as at least a 20% increase in the sum of the longest diameter of target lesions, taking as reference the smallest sum of the longest diameter recorded since treatment started or the appearance of 1 or more new lesions. For non-target lesions, PD was defined as the appearance of 1 or more new lesions and/or unequivocal progression of existing non-target lesions.The PFS will be will be estimated using Kaplan-Meier method. A Kaplan-Meier curve, median PFS, hazard ratio with appropriate confidence intervals will be reported.The PFS will be will be estimated using Kaplan-Meier method. A Kaplan-Meier curve, median PFS, hazard ratio with appropriate confidence intervals will be reported.",
              "timeFrame": "From enrollment to 12 month"
            },
            {
              "measure": "Overall Survival (OS)",
              "description": "Overall Survival (OS), defined as the time from the date of randomization to the date of death, regardless of the cause of death. Participants who were alive at the time of the analysis were censored at the date of the last follow-up assessment. Participants without follow-up assessment were censored at the day of last study medication and participants with no post-baseline information were censored at the date of randomization.The OS will be will be estimated using Kaplan-Meier method. A Kaplan-Meier curve, median OS, hazard ratio with appropriate confidence intervals will be reported.",
              "timeFrame": "From enrollment to 12 month"
            },
            {
              "measure": "Disease control rate(DCR)",
              "description": "DCR was defined as percentage of participants with best (confirmed) overall response (BOR) of either CR or PR or SD. ORR was assessed by the investigator according to RECIST version 1.1 and is based on BOR, which is defined as best response recorded from start of study treatment until disease progression/recurrence or death. Participants needed to have two consecutive assessments of PR or CR or SD to be a responder. Only participants with measurable disease at baseline were included in the analysis of BOR and who did not have any evaluable post-baseline assessments were classified as not evaluable.The ORR will be reported by percentage with each arms and appropriate confidence intervals.",
              "timeFrame": "From enrollment to 12 month"
            }
          ]
        },
        "eligibilityModule": {
          "eligibilityCriteria": "Inclusion Criteria:\n\n1. Patients with advanced unresectable, histologically confirmed adenocarcinoma of the gastric or gastroesophageal junction.\n2. With or without measurable lesions.\n3. Patients must have a performance status of 0-1 on the Eastern Cooperative Oncology Group (ECOG) scale.\n4. Without serious system dysfunction and could tolerate chemotherapy. With normal marrow, liver and renal function: a hemoglobin (HGB) of ≥100g/L (without blood transfusion during 14 days); a leucopenia count of ≥4.0×109/L; a platelet count of ≥100×109/L; a total bilirubin (TBil) of ≤1.5 upper normal limitation (UNL); a creatinine (Cr) of ≤ 1.5 UNL; a creatinine clearance rate ≥ 50ml/min (Cockcroft-Gault); a alanine aminotransferase (ALAT) and aspartate aminotransferase (ASAT) of ≤2.5 UNL or ≤5 UNL in case of liver metastasis.\n5. Life expectancy ≥3 months.\n6. With normal electrocardiogram results and no history of congestive heart failure.\n7. With normal coagulation function: activated partial thromboplastin time (APTT), prothrombin time (PT) and INR, each ≤ 1.5 x ULN.\n8. Female subjects of child-bearing potential must agree to use contraceptive measures starting 1 week before the administration of the first dose of Tislelizumab until 8 weeks after discontinuing study drug. Male subjects must agree to use contraceptive measures during the study and 8 weeks after last dose of study drug\n9. With written informed consent signed voluntarily by patients themselves or their supervisors witted by doctors.\n10. With good compliance and agree to accept follow-up of disease progression and adverse events.\n\nExclusion Criteria:\n\n1. Patients with a history of another neoplastic disease within the past three years, excluding basal cell carcinoma of the skin, cervical carcinoma in situ, or nonmetastatic prostate cancer.\n2. Patients with brain or central nervous system metastases, including leptomeningeal disease.\n3. Pregnant (positive pregnancy test) or breast feeding.\n4. Serious, non-healing wound, ulcer, or bone fracture.\n5. Significant cardiac disease as defined as: unstable angina, New York Heart 6.Association (NYHA) grade II or greater, congestive heart failure, history of myocardial infarction within 6 months Evidence of bleeding diathesis or coagulopathy.\n\n7.History of a stroke or CVA within 6 months. 8.Clinically significant peripheral vascular disease. 9.Inability to comply with study and/or follow-up procedures. Patients with any other medical condition or reason, in that investigator's opinion, makes the patient unstable to participate in a clinical trial.",
