        "participantFlowModule": {
          "recruitmentDetails": "This protocol is open to participants age 18 and above, of either gender and any race/ethnicity. The study is looking at the use of Y-90-DOTA-BC8 in conjunction with a standard reduced-intensity transplant regimen.",
          "groups": [
            {
              "id": "FG000",
              "title": "Treatment (90Y-BC8, Allogeneic PBSC or Bone Marrow Transplant)",
              "description": "PREPARATIVE REGIMEN: Patients receive 90Y-BC8 via central line on approximately day -12, fludarabine phosphate IV over 30 minutes on days -4 to -2, and 2 Gy TBI on day 0.\n\nTRANSPLANTATION: Patients undergo allogeneic PBSC or bone marrow transplant on day 0.\n\nGVHD PROPHYLAXIS: Patients receive mycophenolate mofetil PO or IV every 12 hours on days 0-27 (for patients with related donors) or every 8 hours on days 0-40 with taper to day 96 (for patients with unrelated donors). Patients also receive cyclosporine PO or IV every 12 hours on days -3 to 56 (for patients with related donors) or 100 (for patients with unrelated donors) with taper to day 180.\n\nAllogeneic Bone Marrow Transplantation: Undergo allogeneic bone marrow transplant\n\nAllogeneic Hematopoietic Stem Cell Transplantation: Undergo allogeneic PBSC or bone marrow transplant\n\nCyclosporine: Given PO or IV\n\nFludarabine Phosphate: Given IV\n\nIndium In 111 Anti-CD45 Monoclonal Antibody BC8: Given IV (dosimetric dose)"
            }
          ],
