              "description": "Study participants will receive an infusion of 0.5 mg/kg of ideal body weight of DOTA-BC8 trace labeled with \\~5-10 mCi of Indium-111 to evaluate biodistribution and calculate the radiation absorbed doses to major organs and the whole body. The subsequent therapy infusion of Yttrium-90-DOTA-BC8 will deliver an amount of Yttrium-90 calculated not to exceed the target dose to the critical normal organ receiving the highest radiation dose. The therapy dose will be administered on approximately day -12 of the preparative regimen, which will typically be approximately 1 to 2 weeks after the biodistribution dose."
