        "descriptionModule": {
          "briefSummary": "This study aims to evaluate the safety and tolerance of modified CD19 CAR T cells in treating refractory/relapsed B-cell malignancies. CAR-T cells will be investigated as a single agent both in relapsed/refractory B-cell acute lymphoblastic leukaemia (B-ALL) and up to 60% of patients with B-cell non-Hodgkin's lymphoma (NHL)."
        },
